import "./side-menu.css";
function SideMenu() {
  return (
    <aside>
      <ul>
        <li>
          <a href="#">Projects</a>
        </li>
        <li>
          <a href="#">My Tasks</a>
        </li>
        <li>
          <a href="#">Messages</a>
        </li>
        <li>
          <a href="#">Calendar</a>
        </li>
      </ul>
    </aside>
  );
}

export default SideMenu;
